//IMAGEN
import ImgNovia from "../assets/Images/imgnovia.jpg"
import ImgNadando from "../assets/Images/ImgNadando.jpg"
import ImgRisco from "../assets/Images/risco.jpg"
import ImgPlaya from "../assets/Images/playa.jpg"
import ImgCatarata from "../assets/Images/catarata.jpg"
import ImgNeblina from "../assets/Images/neblina.jpg"
import ImgParis from "../assets/Images/paris.jpg"
import ImgBosque from "../assets/Images/bosque.jpg"
import IMgRisco2 from "../"

const Imagen = {
    imgnovia: ImgNovia,
    imgnadando: ImgNadando,
    imgrisco: ImgRisco,
    imgplaya: ImgPlaya,
    imgcatarata: ImgCatarata,
    imgneblina: ImgNeblina,
    imgparis: ImgParis,
    imgbosque: ImgBosque
};

export const themes = {
    light: {
        imagen:Imagen
    }
};
